        <div className="navBtn">藝術</div>
        <div className="navBtn">美食</div>
        <div className="navBtn">旅遊</div>
        <div className="navBtn">電影</div>
        <div className="navBtn">親子</div>
        <div className="navBtn">期間限定</div>
      </div>
    </>
  );
}
